import Sections from "./sections";

export default function SeasonsFlowers() {
  const items = [
    { title: "Tulips", href: "/flowers/tulips" },
    { title: "Daffodils", href: "/flowers/daffodils" },
    { title: "Hydrangeas", href: "/flowers/hydrangeas" },
    { title: "Sunflowers", href: "/flowers/sunflowers" },
    { title: "Daisies", href: "/flowers/daisies" },
    { title: "Spring Plants", href: "/flowers/springplants" },
  ];
  return <Sections title={"Shop All Spring Flowers"} items={items}></Sections>;
}
